def δ (x : ℕ) : ℕ :=
  if h : x > 0
  then (Finset.filter (λ d, odd d ∧ d ∣ x) (Finset.range (x + 1))).max' (by {
    rw Finset.nonempty,
    use 1,
    simp [h]
  })
  else 0

def δ (x : ℕ) : ℕ :=
  if x = 0 then 0 else
    let divisors := {d : ℕ | d ∣ x ∧ d % 2 = 1}
    in divisors.max' ⟨1, dvd_refl x, nat.one_mod 2⟩

def δ (x : ℕ) : ℕ :=
  if h : x ≠ 0 then
    let divisors := (Finset.filter (λ d, d % 2 = 1) (Finset.divisors x))
    in Option.get (Finset.max' divisors (Finset.nonempty_of_mem (Finset.mem_filter.mpr ⟨(nat.one_mod 2).symm ▸ dvd_refl 1, nat.dvd_one⟩)))
  else 0

def δ (x : ℕ) : ℕ :=
  if h : x = 0 then 1
  else
    let factors := (Finset.filter (λ d, d ∣ x ∧ d % 2 = 1) (Finset.range (x + 1)))
    in factors.max' (Finset.nonempty_of_exists (ExistsOddDivisor h))
